import { ON_ROOMS } from '../actiontypes';

const initialState = {
  rooms: null
};

export const roomsReducer = (state = initialState, action) => {
  switch (action.type) {
    case ON_ROOMS:
      return {  }
    default:
      return state;
  }
};
